INSERT INTO `job` VALUES (1,1,'İNTERNET QURAŞDIRMA VƏ SERVİS ÜZRƏ TEXNİK','- Şirkətə daxil olan ADSL və FO sifarişləri əsasında ünvanda - İnternet qoşulması və abunəçi ünvanlarında yaranana\n- İnternet problemlərin aradan qaldırılması\n- İş şəraiti:\n- İş qrafiki: Həftəiçi hər gün saat 09:00-dan 18:00-dək\n- İstirahət günləri: şənbə və bazar','- Sürücülük vəsiqəsi və sürücülük stajının olması vacibdir\n- Modem və routerin ayarlanması\n- Kabellər haqqında biliklər\n- Kompyuter bilikləri\n- Antivirus bilikləri\n- İnternet və Kompyuter səbəkələri haqqında biliklər\n- Xətt parametrləri necə olmalıdır.SNR, Line attunation, CRC\n- Splitterin düzgün qoşulma qaydası\n- Disconnect zamanı yaranan problemlər, lost carrier, user request\n- Modemin modulyasiyaları və xüsusiyyətləri\n- ADSL 2+, gdmt, g-lite modulyasiyaların fərqi\n- NAT-Network adress translation-haqqında məlumat.\n- DHCP-nədir\n- WIFi şəbəkəsinin qurulması və problemlərin araşdırılması\n- Statik İp ilə dinamik İP-nin fərqi\n- ADSL və fiber internetin fərqi, üstün cəhətləri\n- Assimmetrik və simmetrik yayım arasında fərq',300.00,600.00,'2019-11-19 10:27:55','2019-12-19',2,2,1,3,2,'2019-11-20 06:28:04',NULL,97,2,1),(2,3,'OFİS MENECERİ',' Ofis daxili işlərin icra olunması  \n- Arayış,məktub,protokol və s.sənədlərin düzgün tərtib edilməsi \n- Daxil olan telefon zənglərinin qəbul edilməsi  \n- İşgüzar danışıqların aparılması \n- İş yeri Ayna Sultanova yaxin ərazidə \n- Rəhbərlik tərəfindən verilən tapşırıqların yerinə yetirilməsi\n- İş qrafiki: 09:00-dan 19:00-dək \n- Həftədə 1 dəfə istirahət günü ','Namizədə tələblər\n- Xanım və bəy namizədlər \n- Azərbaycan dilində səlis danışıq (rus dili arzu olunandır) \n- Türk dilini bilməli \n- 1C programını bilməli \n- Kompüter bilikləri: MS Office yaxşı səviyyədə bilməsi \n- Kollektivlə işləmə bacarigi \n- Nitq mədəniyyəti',700.00,900.00,'2019-11-20 06:28:24','2019-12-19',2,2,1,3,2,'2019-11-20 06:28:24',NULL,105,5,0),(3,3,'PİLATES TRENERİ',' İş barədə məlumat\n- İş qrafiki: 8 saat + 1 saat nahar \n- Həftənin 6 günü iş günü \n- İstirahət bazar günü \n- 1 ay sınaq müddətini müvəffəqiyyətlə başa vurmuş namizədlər \nmərkəz tərəfindən təlimlərə göndərilərək sertifikatla\n təmin olunur və müqavilə əsasında mərkəzə işə götürülür','- Cinsi qadın \n- Azəri dili mükəmməl rus dili orta \n- Səliqəli punktual xoş görünüşlü olmalı \n- Ünsiyyətcil olmalı \n- Komandada işləmə bacarığı olmalı \n- İşə məsuliyyətli yanaşmalı \n- İdmana həvəsli olmalı',800.00,1000.00,'2019-11-20 06:32:38','2020-01-19',4,2,3,5,0,'2019-11-20 06:32:38',NULL,105,5,0),(4,5,'OPTİK MƏSLƏHƏTÇİ','- Optik məhsulların satışının həyata keçirilməsi\n- Müştərilərə ətraflı məlumat vermək\n- Optik bölmənin səliqəsinə nəzarət\n- İş qrafiki 09:00-dan 20:00-dək\n- Əmək haqqı 300-350-400 AZN + satışdan 5% və əlavə bonuslar\n- Karyera imkanları\n- AR Əmək məcəlləsinə uyğun sənədləşmə','- 26 yaşdan yuxarı ali təhsilli xanımlar\n- Azərbaycan dilində səlis və gözəl nitqə sahib olmaq\n- Rus və ingilis dili bilikləri arzuolunandır\n- Yüksək mənimsəmə qabiliyyəti\n- Ünsiyyətcil, gülərüz və məsuliyyətli olmaq\n\nSeçilən namizədlər peşəkarlar tərəfindən keçirilən təlimlərdən sonra işlə təmin olunacaqdır.',300.00,400.00,'2019-11-15 10:27:55','2019-12-15',2,2,1,1,1,'2019-11-20 06:33:11',NULL,107,3,1),(5,63,'WORDPRESS PROGRAMÇI','- Proqram təminatını yazmaq\n- Mövcud proqramların üzərində dəyişiklik etmək\n- Texniki şərtə uyğun alqoritm hazırlamaq və yazılacaq proqramın işləmə mexanizmini tərtib etmək\n- Sistem problemlərinin həlli və diaqnostikası\n- İşləri tələb olunan vaxtda yekunlaşdırmaq\n- İş şəraiti\n- 10:00-dan 18:00-dək\n- Caspian Plaza, Cəfər Cabbarlı 44\n- İşə frilancer olaraq başlanacaq\n- Mehriban kollektiv\n- Karyera imkanı\n- Uzunmüddətli əməkdaşlıq','- Proqram təminatını yazmaq\n- Mövcud proqramların üzərində dəyişiklik etmək\n- Texniki şərtə uyğun alqoritm hazırlamaq və yazılacaq proqramın işləmə mexanizmini tərtib etmək\n- Sistem problemlərinin həlli və diaqnostikası\n- İşləri tələb olunan vaxtda yekunlaşdırmaq\n- İş şəraiti\n- 10:00-dan 18:00-dək\n- Caspian Plaza, Cəfər Cabbarlı 44\n- İşə frilancer olaraq başlanacaq\n- Mehriban kollektiv\n- Karyera imkanı\n- Uzunmüddətli əməkdaşlıq',500.00,800.00,'2019-11-08 10:27:55','2019-12-08',2,2,1,3,2,'2019-11-20 06:33:37',NULL,91,5,0),(6,10,'İT ÜZRƏ MÜTƏXƏSSİS','- İş qrafiki: həftənin 6 günü. Həftə içi 10:00-17:00, şənbə günü isə 10:00-15:00\n- Ümumi kompüter bilikləri\n- Kompüter və printer avadanlıqlarının fəaliyyətini təmin etmək və avadanlıqlarda baş vermiş nasazlıqları yerində həll etmək\n- Qısa müddət ərzində problemi aşkar etmək və aradan qaldırmaq bacarığı\n- İT sahəsində geniş bacarıqlara malik olmalı\n- Verilənlər bazalarının qurulması\n- İstifadəçilərin üzləşdikləri çətinliklərin çevik həll olunması\n- Mütəmadi profilaktik tədbirlərin görülməsi\n- Networking\n- Şəbəkə kabel çəkilişi biliklərinə malik olmaq\n- Yaddaş qurğuları ilə işləmək bacarığı\n- Server və yaddaş qurğularında qarşıya çıxan problemlərin həlli\n- İnformasiya sistemlərinin təhlükəsizliyinin təmin edilməsi üzrə həllər\n- İnformasiya sistemlərinin şəbəkə, aralıq serverlər, məlumat bazaları və s. digər səviyyələrdə təhlükəsizliyin daimi nəzarətdə saxlanılması\n- Kompüter şəbəkələrinin monitorinqini aparmaq və şəbəkələrdə yaranmış nasazlıqları aradan qaldırmaq\n- Proqram təminatında texniki probemləri aradan qaldırmaq\n- Windows əməliyyat sistemlərinin idarə edilməsi\n- Əməliyyat sistemlərinin və proqram təminatlarının yazılması, ayarlanması və yaranan problemlərin həll olunması\n- Proqramlaşdırma sahəsi üzrə\n- Məlumat bazaları inzibatçılığı üzrə\n- Verilənlər bazalarının qurulması\n- İstifadəçilərin üzləşdikləri çətinliklərin çevik həll olunması\n- Müxtəlif proyektlərin həcminin müəyyənləşdirilərək müvafiq verilənlər bazalarının təşkili\n- Ehtiyat nüsxələrin alınması, mütəmadi olaraq bu nüsxələrdən bərpanın mümkünlüyünün yoxlanılması\n- Linux Unix C əməliyyat sistemlərinin idarə edilməsi\n- Yaddaş qurğuları ilə işləmək bacarığı\n- Müvafiq qaydaların yaradılması və tətbiqinin təmini\nNamizədə tələblər\nDövlət ali təhsil müəssisələrinin məzunlarına (Kompüter elmləri, Kompüter mühəndisliyi, İnformasiya texnologiyaları və sistemləri mühəndisliyi, Tətbiqi riyaziyyat, Fizika, Elektronika, Telekommunikasiya və digər mühəndis ixtisasları üzrə) üstünlük veriləcəkdir.','- Dövlət ali təhsil müəssisələrinin məzunlarına (Kompüter elmləri, Kompüter mühəndisliyi, İnformasiya texnologiyaları və sistemləri mühəndisliyi, Tətbiqi riyaziyyat, Fizika, Elektronika, Telekommunikasiya və digər mühəndis ixtisasları üzrə) üstünlük veriləcəkdir.\n- Ümumi tələblər:\n- Nizam-intizamlı\n- 5 ildən yuxarı əmək stajı\n- Yüksək səviyyəli məntiqi-analitik düşüncə qabiliyyəti və riyazi biliklər\n- Kollektivlə işləmək bacarığı, diqqətlilik, məsuliyyət və düzgünlük kimi müsbət xarakterlərə malik olan\n- Texniki səviyyədə ingilis dili (daha yaxşı bilənlərə üstünlük verilir)\n- İş prosesində Müəssisə rəhbərliyinin tapşırıqlarını vaxtında və lazımi qaydada yerinə yetirmək\n\nCV göndərərkən mövzu hissəsində \"İT mütəxəssis\" vakansiyasını qeyd etməklə gunel.aliyeva@yenihayat.az elektron ünvanına göndərməyiniz xahiş olunur.',800.00,1000.00,'2019-11-13 10:27:55','2019-12-13',2,2,5,10,1,'2019-11-20 06:34:32',NULL,94,5,0),(7,1,'İNFORMASİYA TEXNOLOGİYALARI ŞÖBƏSİNİN MÜDİRİ','- İş vaxtı: Həftənin 5 günü, 9:00-dan 18:00-dək\n- Cəmiyyətin və törəmə müəssisələrinin İnformasiya Texnologiyaları şöbəsinin fəaliyyətinin effektiv idarə olunması və mütəmadi optimizasiyası\n- Cəmiyyətin İT infrastrukturu daxilində fəaliyyət göstərən server və servislərin idarə olunması və təhlükəsizliyinin təmin olunması\n- Sistemlərin və məlumatların mütəmadi rezerv nüsxələnməsini təmin etmək\n- Cəmiyyətin cari və perspektiv inkişafının İT şöbəsi tərəfindən dəstəklənməsi və inkişafında iştirak\n- Şöbənin cari və gələcək fəaliyyətini istiqamətləndirən plan, təlimat, qayda və sair sənədlərin hazırlanması\n','- Ali texniki və ya iqtisadi təhsil mütləqdir\n- Müxtəlif inteqrasiyaların keçirilməsində təcrübə\n- Windows əməliyyat sistemləri (10 / 2012 / 2016),\nvirtualizasiya (Vmware), Office365, rezerv nüsxələmə sistem və servisləri üzrə biliklər və təcrübə\n- MBİS (MS SQL, POSTGRES), ERP (1C) üzrə biliklər və təcrübə\n- İT layihələrinin idarəolunması üzrə təcrübə\n- Zərurət yarandıqdan ezamiyyətlərə getmək\n- Azərbaycan dilində sərbəst yazı, rus və ingilis dili bilikləri arzuolunandır\n- İnformasiya Texnologiyaları sahəsində 5 ildən yuxarı, rəhbər vazifədə 2 ildən az olmayaraq iş təcrübəsi',800.00,1500.00,'2019-10-14 10:27:55','2019-12-14',1,1,1,3,1,'2019-11-20 06:39:26',NULL,97,5,0),(8,1,'FULL STACK VEB PROQRAMÇI',' İnternet üzərindən reklamın idarə edilməsi sisteminin qurulması və təkmilləşdirilməsində iştirak etmək\n- Uzunmüddətli (bir neçə il) əməkdaşlığa hazır olmaq, yaxın illərdə əsgərlik, xaricdə təhsil almaq və s. planların olmaması\n- İş vaxtı: I - V günlər, saat 09:00-dan 18:00-dək\n- İş yeri: World Business Centre, 309 S. Rəhimov küç., 12-ci mərtəbə\n- Müraciətlər yalnız CV şəklində qəbul olunacaqdır. CV ilə yanaşı Portfolionu da göndərmək üstünlükdür. Məktubunuzun \"Subject\" hissəsində veb proqramçı qeyd edin',' PHP (Codeigniter), MySQL\n- VueJS (VueJS bilənlərə üstünlük verilir)\n- Analitik düşünmə və düzgün dəyərləndirmə qabiliyyəti\n- Səliqəli və oxunaqlı kodun yazılması',700.00,1500.00,'2019-11-19 10:27:55','2019-12-19',9,2,1,3,1,'2019-11-20 06:45:44',NULL,97,5,0),(9,4,'MANTAJÇI','- Çox mənzilli domofon avadanlığının quraşdırılması\n- Nasaz olan domofon avadanlığının təmiri\n- Cihazlardakı proqram və texniki nasazlıqların aradan qaldırılması\n- Abunəçilər tərəfindən şirkətə verilmiş sifarişlərin yerinə yetirilməsi\n- İşlərin keyfiyyətlə həyata keçirilməsinin təmin edilməsi\n- Rəhbərliyin tapşırıq və göstərişlərinin yerinə yetirilməsi\n- Təhlükəsizlik texnikasına, əmək mühafizəsinin qaydalarına riayət edilməsi\n- Kabelləşmə işləri\n- Şirkətin daxili iş qaydalarına riayət edilməsi.\n- 5 günlük iş qrafiki\n- İş qrafiki: 09:00-dan 18:00-dək','- 25-45 yaş arası\n- Domofon avadanlığının montaj və təmir metodlarını bilməli\n- Müvafiq sahədə iş təcrübəsi 1 ildən az olmamaq şərtilə\n- Təhlükəsizlik Sistemləri sahəsində müəyyən təcrübəsi olması vacibdir\n- Texniki sənədləri , sxemləri və planları oxumaq bacarığı\n- Ustaya lazım olan alətlərlə işləməyi bacaran: Drel, perfarator, multimer və.s\n-Elektrik işindən anlayışı olmalı\n- Kollektiv ilə işləmə bacarığı\n- Stressə davamlı, diqqətli, çevik və məsuliyyətli.\n- Avadanlığın təmirdən sonra qəbul və təhvil verilmə qaydasını bilməli\n- Yaxşı şəxsiyyətlərarası və ünsiyyət bacarıqları.\n- Nəqliyyat vasitəsi (avtomobil,moped , motosikl) olanlara üstünlük veriləcək\n\nCV göndərərkən mövzu yerində vəzifəni qeyd edin vəzifə qeyd olunmayan CV-lər baxilmayacag',500.00,700.00,'2019-11-19 10:27:55','2019-12-18',8,2,1,3,1,'2019-11-20 06:45:44',NULL,96,5,0),(12,1,'Maliyyə / Kassir','- DALGA market yasamalda inşaatçılar metrosu\n- İş saati: səhər: 09:00-dan 21:00-dək\n- Gecə smen: 21:00-dan 09:00-dək\n- Nahar market tərəfindən verilir\n- Ayda 3 istirahət\n','\n- Təcrubəli olmalıdır\n- Kassir xanım ya bəy tələb olunur\n- Satıcı sürlük şöbəsi',800.00,1000.00,'2019-11-19 10:27:55','2019-12-19',2,2,1,3,1,'2019-11-20 06:58:25',NULL,97,5,0),(18,1,'WORKSHOP TECHNİCİAN INTERN','- Work schedule- monday-friday (08:00-17:00)\n- Perform maintenance/testing on subsea equipment according to scope description in service orders and\nprocedures\n- Perform sja\n- Contribute to risk analyses\n- Report executed maintenance and testing\n- Report need for maintenance and calibration of workshop tools\n- Troubleshoot workshop tools and relevant subsea products\n- Interpret and read hydraulic circuits\n- Troubleshoot hydraulic equipment\n- Interpret and read electric circuits\n- Troubleshoot electro mechanics equipment\n- Contribute to improve workshop processes and documentation\n- Make sure working area and workshop is tidy/clean and safe\n- Take part in modifications and project assignment when required','- Certificate of relevant apprenticeship (subsea Installation, mechanic, automation, electro etc.)\n- Relevant experience\n- Knowledge about relevant subsea equipment and tools is preferred\n- Good oral and written english language skills',1200.00,1500.00,'2019-11-10 11:27:55','2019-12-20',2,2,1,3,1,'2019-11-20 07:16:30',NULL,97,5,0),(19,63,'Frontend Developer','İş barədə məlumat\nOur company is looking for a talented Front End Developer & UX / UI Designer\nWe would like to hire someone who has a great design eye and front end development skills\nThis position requires a high level of creativity, as well as the ability to choose the right color scheme and typography\nThe successful candidate should also be detail-oriented and committed to meeting tight deadlines, has a strong discipline about work hours.\n- Working Hours: Monday-Friday: 09:00 - 18:00, Saturday: 10:00-15:00\n- Job Responsibilities:\n- Research for the design guidelines, color scheme and typography\n- Designing website UI and developing on the front end\n- Responsible for delivering high quality features on new and existing web applications using HTML, CSS, and JavaScript\n- Understanding the client’s brand and business type set by our team\n- Create intuitive, robust, and reusable user interfaces with JavaScript and associated frameworks\n- Convert UI specifications into clean and easy to maintain responsive web pages\n- Find solutions for cross-browser issues in both HTML/CSS and JavaScript','Namizədə tələblər\n- Experience in HTML, CSS, and JavaScript, cross-browser compatible and mobile-friendly environments\n- Minimum 1 year of experience in Web Development\n- Strong research skills and a great design eye\n- Ability to work with Figma, Sketch, Adobe Photoshop or Adobe XD\n- Understanding React JS, Vue JS or Python Django is a plus\n- Strong organizational and time-management skills\n- Ability to write both short and long format content\n- Understanding of CSS and experience with preprocessors (Less, Sass)\n- Attention to detail for tasks both big and small\n- Analytical Thinking\n\nIf you are interested in this position, do not hesitate to send your CV/resume to sabuhi@webzool.com with indicating the name of the position in the subject field',750.00,1000.00,'2019-11-23 12:51:39','2019-12-31',2,2,1,2,1,'2019-11-23 12:51:39',NULL,91,5,0),(20,3,'ANDROİD PROQRAMCI','İş barədə məlumat\n- Əməkhaqqı fərdi qaydada təyin edilir\n- İş rejimi: Həftədə 6 gün (İstirahət günləri: Bazar)\n- İş saatları: 10:00-dan 19:00-dək','Namizədə tələblər\n- Əməkhaqqı fərdi qaydada təyin edilir\n- Android Studio ilə işləmə bacarığı\n- Java(Android) proqramlaşdırma dili ilə işləmə bacarığı\n- Android - Material Design (UI/UX)\n- SQLite bilikləri\n- REST web service\n- Minimum 1 app nümunəsi göstərməli\n- Solid experience with UI – fragments and activities\n- Experience interacting with RESTful API\n- Git\n- Komanda tərkibində işləmə bacarığı\n- Retrofitlə işləmə bacarığı;\n- ConstraintLayoutla işləmə bacarığı\n- Analitik düşünmə qabiliyyəti\n- Sərbəst araşdırma qabiliyyəti\n\nCV-siz namizədlərə baxılmır.Seçimlərə düşmək üçün şəkilli CV-nizi office@hajma.info mail ünvanına göndərmək mütləqdir',500.00,800.00,'2019-12-08 18:18:41','2019-12-29',2,2,0,1,0,'2019-12-08 18:18:41',NULL,90,5,0),(22,3,'Test Jobs position',' İş barədə məlumat\n- İş qrafiki: 8 saat + 1 saat nahar \n- Həftənin 6 günü iş günü \n- İstirahət bazar günü \n- 1 ay sınaq müddətini müvəffəqiyyətlə başa vurmuş namizədlər \nmərkəz tərəfindən təlimlərə göndərilərək sertifikatla\n təmin olunur və müqavilə əsasında mərkəzə işə götürülür','- Cinsi qadın \n- Azəri dili mükəmməl rus dili orta \n- Səliqəli punktual xoş görünüşlü olmalı \n- Ünsiyyətcil olmalı \n- Komandada işləmə bacarığı olmalı \n- İşə məsuliyyətli yanaşmalı \n- İdmana həvəsli olmalı',1800.00,3000.00,'2019-12-08 18:18:41','2020-02-18',4,2,3,5,0,'2019-12-09 13:19:55',NULL,105,1,0);
